// import years_data from "./years_data";
// import { years_data } from "./years_data_small_for_testing.js";
// import { years_data } from "./1756_1783_structured.js";
// import { years_data } from "./2013_2017_structured.js";
import { years_data } from "./2015_radiation.js";

// Returns the data for the specific year.
export function getYear(year) {
  return years_data.find((y) => y.year === year);
}
